import React from "react";
import { View, Text, Image } from "react-native";

export default function FloatMenu(){
    return(
        <View>
            <Image source={require('../../assets/arrows')}></Image>
            <Image source={require('../../assets/money')}></Image>
            <Image source={require('../../assets/shop')}></Image>
        </View>
    )
}
